import React , {Component} from 'react';
import {post} from 'axios';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';


const styles = theme => ({
    hidden: {
        display: 'none'
    },
});

class SignInForm extends Component{
    constructor(props){
        super(props);
        this.state = {
            userId : '',
            userPwd : ''
        }
    }

    handleClickOpen = (e) => {
        this.setState({
            open: true
        });
    }

    handleClose = (e) => {
        this.setState({
            open: false
        })
    }

    render(){
        const { classes } = this.props;
        return(
            <div>
                <Button variant="contained" color="#fff000" onClick={this.handleClickOpen}>
                    로그인
                </Button>
                <Dialog open={this.state.open} onClose={this.handleClose}>
                    <DialogTitle>고객 추가</DialogTitle>
                    <DialogContent>
                        email<TextField label="email" type="text" name="userEmail" value={this.state.userEmail} onChange={this.handleValueChange} /><br/>
                        password<TextField label="password" type="text" name="userPwd" value={this.state.userPwd} onChange={this.handleValueChange} /><br/>
                    </DialogContent>
                    <DialogActions>
                        <Button variant="contained" color="primary" onClick={this.handleFormSubmit}>로그인</Button>
                        <Button variant="outlined" color="primary" onClick={this.handleClose}>닫기</Button>
                    </DialogActions>
                </Dialog>
            </div>
        )
    }
}

export default SignInForm;
